description:
A APP ENSA Saúde foi desenvolvida a pensar em si, permite-lhe gerir o seu Seguro ENSA Saúde, através das seguintes funcionalidades:

•	Consulta dos plafonds das coberturas do seu Seguro ENSA Saúde;
•	Geolocalização dos Prestadores Médicos em todo País;
•	Acompanhamento dos seus Pedidos de Reembolso;
•	Acesso ao seu Cartão ENSA Saúde Digital; e
•	Apresentação de sugestões à ENSA.

Este canal está disponível para si 24 horas por dia e todos os dias da semana.

Instale já, registe-se e sinta-se acolhido(a) pela ENSA, a estrela que protege — agora mais digital, por si e para si.
